/* 2017 New York City mayoral campaign */Deleting the section due to it being factually inaccurate. the Article cited state, "Correction: March 24, 2017
An earlier version of this article misstated when Roque De La Fuente would need to establish residency in New York City. It would need to be before election day, not before taking office."

Either no one actually read the cited article or it's inclusion was done on purpose.
